import "./ExpenseList.css";
import ExpenseItem from "./ExpenseItem";

const ExpenseList = (props) => {
  return;
  {
    props.item.length === 0 ? (
      <p>No Expenses Found.</p>
    ) : (
      props.item.map((expense) => (
        <ExpenseItem
          key={expense.id}
          title={expense.title}
          amount={expense.amount}
          date={expense.date}
        />
      ))
    );
  }
};
export default ExpenseList;
